import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const useStyles = makeStyles({
  table: {
    minWidth: 650,
  },
});

function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}

const rows = [
  createData('BreakFast','Frozen yoghurt', 159, 6.0, 24, 4.0),
  createData('Lunch','Ice cream sandwich', 237, 9.0, 37, 4.3),
  createData('Dinner', 262, 16.0, 24, 6.0),
  createData('Night', 305, 3.7, 67, 4.3),
];


async function getPatientData(){

  console.log("Chamei funçao getPatientData");

  localStorage.setItem("patient_id", 1);
  let patient_id = localStorage.getItem("patient_id");

  let url = "http://localhost:9000/patients/" + patient_id;

  let data = await fetch(url, {
    method: 'GET',
    headers: new Headers({
      'Content-Type': 'application/json',
      'Authorization': localStorage.getItem('token')
    })
  });

  let response = await data.json();
  console.log(response);
  console.log(response.message.pills_not_took);

}

export default function BasicTable() {

  const classes = useStyles();

  getPatientData();

  return (
    <>
        <div className="content">
            <TableContainer component={Paper}>
            <Table className={classes.table} aria-label="simple table">
                <TableHead>
                <TableRow>
                    <TableCell></TableCell>
                    <TableCell align="right">Monday</TableCell>
                    <TableCell align="right">Tuesday</TableCell>
                    <TableCell align="right">Wednesday</TableCell>
                    <TableCell align="right">Thursday</TableCell>
                    <TableCell align="right">Friday</TableCell>
                    <TableCell align="right">Saturday</TableCell>
                    <TableCell align="right">Sunday</TableCell>
                </TableRow>
                </TableHead>
                <TableBody>
                {rows.map((row) => (
                    <TableRow key={row.name}>
                    <TableCell >
                        {row.name}
                    </TableCell>
                    <TableCell align="right">{row.calories}</TableCell>
                    <TableCell align="right">{row.fat}</TableCell>
                    <TableCell align="right">{row.carbs}</TableCell>
                    <TableCell align="right">{row.protein}</TableCell>
                    </TableRow>
                ))}
                </TableBody>
            </Table>
            </TableContainer>
        </div>
    </>
  );
}
